import React from "react";

interface Props<T> {
    name: string;
    imagePath: string;
    onBarkButton: () => void;
}

function DogDetails <T extends object>(props: Props<T>) {
    return (
        <div className="DogDetails">
            <button data-test="buttonAlert" onClick={props.onBarkButton}>Bark</button>
            <h1>{props.name}</h1>
            <img src={props.imagePath} width="400" height="200" alt=""/>
        </div>
    );
}

export default DogDetails;

